import {get_contact} from '../constant/contacConstant';


export const contactReducer = (state={allQuries:[{name:"test",email:"test@test.com"}]},{type,payload})=>{
        switch (type) {
            case get_contact:
                return{
                    ...state,
                    allQuries: payload
                }
            default:
                return state;
        }
}
